import React, { useContext } from "react";
import { UserContext } from "../App";
import { useNavigate, Link, Outlet } from "react-router-dom";

export default function ProfileDashboard() {

    const { setUser, setPwd } = useContext(UserContext);
    const navigate = useNavigate();

    const handleSignOut = () => {
        setUser('');
        setPwd('');
        navigate('/');
    }

    return (
        <div>
            <div className="d-flex">
                <nav className="navbar fixed-left navbar-dark bg-dark profile-nav">
                    <ul>
                        <li>
                            <Link to="/profile/home">Home</Link>
                        </li>
                        <li>
                            <Link to="/profile/settings">Settings</Link>
                        </li>
                        <li>
                            <button className="btn btn-primary" onClick={(e) => handleSignOut()}>Log out</button>
                        </li>
                    </ul>
                </nav>

                <Outlet className="outlet" />
            </div>
        </div>
    )
}
